import React from "react";
import { Card } from "primereact/card";

export default function BasicDemo(props) {
  //console.log(props.data);

  // const selectedUser=props.data.map(({ key, value }) => ({ [key]: value }));
  return (
    <div className="card">
      <Card title={props.data.name}>
        <p className="m-0"></p>
      </Card>
    </div>
  );
}
